import{_ as l}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as i,c as t,f as d}from"./app.484519fe.js";const e={},o=d("<hr><p>\u8F6F\u4EF6\u5DE5\u7A0B\u7684\u57FA\u672C\u8981\u7D20\uFF1A\u65B9\u6CD5\u3001\u5DE5\u5177\u548C\u8FC7\u7A0B</p><hr><p>\u8F6F\u4EF6\u751F\u5B58\u5468\u671F</p><ol><li>\u53EF\u884C\u6027\u5206\u6790\u4E0E\u9879\u76EE\u5F00\u653E\u8BA1\u5212</li><li>\u9700\u6C42\u5206\u6790\uFF1A\u786E\u5B9A\u8F6F\u4EF6\u8981\u5B8C\u6210\u7684\u529F\u80FD\u53CA\u975E\u529F\u80FD\u6027\u8981\u6C42</li><li>\u6982\u8981\u8BBE\u8BA1\uFF1A\u5C06\u9700\u6C42\u8F6C\u5316\u4E3A\u8F6F\u4EF6\u7684\u6A21\u5757\u5212\u5206\uFF0C\u786E\u5B9A\u6A21\u5757\u4E4B\u95F4\u7684\u8C03\u7528\u5173\u7CFB</li><li>\u8BE6\u7EC6\u8BBE\u8BA1\uFF1A\u5C06\u6A21\u5757\u8FDB\u884C\u7EC6\u5316\uFF0C\u5F97\u5230\u8BE6\u7EC6\u7684\u6570\u636E\u5E93\u7ED3\u6784\u548C\u7B97\u6CD5</li><li>\u7F16\u7801\uFF1A\u6839\u636E\u8BE6\u7EC6\u8BBE\u8BA1\u8FDB\u884C\u4EE3\u7801\u7F16\u5199\uFF0C\u5F97\u5230\u53EF\u8FD0\u884C\u7684\u8F6F\u4EF6\uFF0C\u5E76\u8FDB\u884C\u5355\u5143\u6D4B\u8BD5</li><li>\u6D4B\u8BD5</li><li>\u7EF4\u62A4</li></ol><hr><p>\u8F6F\u4EF6\u8FC7\u7A0B</p><p>\u80FD\u529B\u6210\u719F\u5EA6\u6A21\u578B(Capability Maturity Model,CMM)\uFF1ACMM\u662F\u56FD\u9645\u516C\u8BA4\u7684\u5BF9\u8F6F\u4EF6\u516C\u53F8\u8FDB\u884C\u6210\u719F\u5EA6\u7B49\u7EA7\u8BA4\u8BC1\u7684\u91CD\u8981\u6807\u51C6\u3002CMM\u5171\u5206\u4E94\u7EA7\u3002\u5728\u6BCF\u4E00\u7EA7\u4E2D\uFF0C\u5B9A\u4E49\u4E86\u8FBE\u5230\u8BE5\u7EA7\u8FC7\u7A0B\u7BA1\u7406\u6C34\u5E73\u6240\u5E94\u89E3\u51B3\u7684\u5173\u952E\u95EE\u9898\u548C\u5173\u952E\u8FC7\u7A0B\u3002\u6BCF\u4E00\u8F83\u4F4E\u7EA7\u522B\u662F\u8FBE\u5230\u8F83\u9AD8\u7EA7\u522B\u7684\u57FA\u7840\u3002</p><ul><li>\u4E94\u7EA7\u662F\u6700\u9AD8\u7EA7\uFF0C\u5373<code>\u4F18\u5316\u7EA7</code>\uFF0C\u8FBE\u5230\u8BE5\u7EA7\u7684\u8F6F\u4EF6\u516C\u53F8\u8FC7\u7A0B\u53EF\u81EA\u53D1\u5730\u4E0D\u65AD\u6539\u8FDB\uFF0C\u9632\u6B62\u540C\u7C7B\u95EE\u9898\u4E8C\u6B21\u51FA\u73B0\uFF1B</li><li>\u56DB\u7EA7\u79F0\u4E3A<code>\u5DF2\u7BA1\u7406\u7EA7</code>\uFF0C\u8FBE\u5230\u8BE5\u7EA7\u7684\u8F6F\u4EF6\u516C\u53F8\u5DF2\u5B9E\u73B0\u8FC7\u7A0B\u7684<strong>\u5B9A\u91CF\u5316</strong>\uFF1B</li><li>\u4E09\u7EA7\u4E3A<code>\u5DF2\u5B9A\u4E49\u7EA7</code>\uFF0C\u5373\u8FC7\u7A0B\u5B9E\u73B0<strong>\u6807\u51C6\u5316</strong>\uFF1B</li><li>\u4E8C\u7EA7\u4E3A<code>\u53EF\u91CD\u590D\u7EA7</code>\uFF0C\u8FBE\u5230\u8BE5\u7EA7\u7684\u8F6F\u4EF6\u516C\u53F8\u8FC7\u7A0B\u5DF2<strong>\u5236\u5EA6\u5316</strong>\uFF0C\u6709\u7EAA\u5F8B\uFF0C\u53EF\u91CD\u590D\uFF1B</li><li>\u4E00\u7EA7\u4E3A<code>\u521D\u59CB\u7EA7</code>\uFF0C\u8FC7\u7A0B\u65E0\u5E8F\uFF0C\u8FDB\u5EA6\u3001\u9884\u7B97\u3001\u529F\u80FD\u548C\u8D28\u91CF\u7B49\u65B9\u9762\u4E0D\u53EF\u9884\u6D4B\u3002</li></ul><hr><p>CMMI\u5206\u7EA7</p><table><thead><tr><th>\u7B49\u7EA7</th><th>\u8BF4\u660E</th></tr></thead><tbody><tr><td>CL0\uFF08\u672A\u5B8C\u6210\u7684\uFF09</td><td>\u8FC7\u7A0B\u57DF\u672A\u6267\u884C\u6216\u672A\u5F97\u5230CL1\u4E2D\u5B9A\u4E49\u7684\u6240\u6709\u76EE\u6807</td></tr><tr><td>CL1\uFF08\u5DF2\u6267\u884C\u7684\uFF09</td><td>\u5176\u5171\u6027\u76EE\u6807\u662F\u8FC7\u7A0B\u5C06\u53EF\u6807\u8BB0\u7684\u8F93\u5165\u5DE5\u4F5C\u4EA7\u54C1\u8F6C\u6362\u6210\u79D1\u8868\u793A\u7684\u8F93\u51FA\u5DE5\u4F5C\u4EA7\u54C1\uFF0C\u5DF2\u5B9E\u73B0\u652F\u6301\u8FC7\u7A0B\u57DF\u7684\u7279\u5B9A\u76EE\u6807</td></tr><tr><td>CL2\uFF08\u5DF2\u7BA1\u7406\u7684\uFF09</td><td>\u5176\u5171\u6027\u76EE\u6807\u662F\u96C6\u4E2D\u4E8E\u5DF2\u7BA1\u7406\u7684\u8FC7\u7A0B\u7684\u5236\u5EA6\u5316\u3002\u6839\u636E\u7EC4\u7EC7\u7EA7\u653F\u7B56\u89C4\u5B9A\u8FC7\u7A0B\u7684\u8FD0\u4F5C\u5C06\u4F7F\u7528\u90A3\u4E2A\u8FC7\u7A0B\uFF0C\u9879\u76EE\u9075\u5FAA\u5DF2\u6587\u6863\u5316\u7684\u8BA1\u5212\u548C\u8FC7\u7A0B\u63CF\u8FF0\uFF0C\u6240\u6709\u6B63\u5728\u5DE5\u4F5C\u7684\u4EBA\u90FD\u6709\u6743\u4F7F\u7528\u8DB3\u591F\u7684\u8D44\u6E90\uFF0C\u6240\u6709\u5DE5\u4F5C\u4EFB\u52A1\u548C\u5DE5\u4F5C\u4EA7\u54C1\u90FD\u88AB\u76D1\u63A7\u3001\u63A7\u5236\u548C\u8BC4\u5BA1</td></tr><tr><td>CL3\uFF08\u5DF2\u5B9A\u4E49\u7EA7\u7684\uFF09</td><td>\u5176\u5171\u6027\u76EE\u6807\u96C6\u4E2D\u4E8E\u5DF2\u5B9A\u4E49\u7684\u8FC7\u7A0B\u7684\u5236\u5EA6\u5316\u3002\u8FC7\u7A0B\u662F\u6309\u7167\u7EC4\u7EC7\u7684\u88C1\u526A\u6307\u5357\u4ECE\u7EC4\u7EC7\u7684\u6807\u51C6\u8FC7\u7A0B\u4E2D\u526A\u88C1\u5F97\u5230\u7684\uFF0C\u8FD8\u5FC5\u987B\u6536\u96C6\u8FC7\u7A0B\u8D44\u4EA7\u548C\u8FC7\u7A0B\u7684\u5EA6\u91CF\uFF0C\u5E76\u7528\u4E8E\u5C06\u6765\u5BF9\u8FC7\u7A0B\u7684\u6539\u5B9A</td></tr><tr><td>CL4\uFF08\u5B9A\u91CF\u7BA1\u7406\u7EA7\u7684\uFF09</td><td>\u5176\u5171\u6027\u76EE\u6807\u96C6\u4E2D\u4E8E\u53EF\u5B9A\u91CF\u7BA1\u7406\u7684\u8FC7\u7A0B\u7684\u5236\u5EA6\u5316\u3002\u4F7F\u7528\u6D4B\u91CF\u548C\u8D28\u91CF\u4FDD\u8BC1\u6765\u63A7\u5236\u548C\u6539\u8FDB\u8FC7\u7A0B\u57DF\uFF0C\u5EFA\u7ACB\u548C\u4F7F\u7528\u5173\u4E8E\u8D28\u91CF\u548C\u8FC7\u7A0B\u6267\u884C\u7684\u8D28\u91CF\u76EE\u6807\u4F5C\u4E3A\u7BA1\u7406\u51C6\u5219</td></tr><tr><td>CL5\uFF08\u4F18\u5316\u7684\uFF09</td><td>\u4F7F\u7528\u91CF\u5316\uFF08\u7EDF\u8BA1\u5B66\uFF09\u624B\u6BB5\u6539\u53D8\u548C\u4F18\u5316\u8FC7\u7A0B\u57DF\uFF0C\u4EE5\u6EE1\u8DB3\u5BA2\u6237\u7684\u6539\u53D8\u548C\u6301\u7EED\u6539\u8FDB\u8BA1\u5212\u4E2D\u7684\u8FC7\u7A0B\u57DF\u7684\u529F\u6548</td></tr></tbody></table><hr><p>\u8F6F\u4EF6\u8FC7\u7A0B\u6A21\u578B</p><ul><li>\u7011\u5E03\u6A21\u578B(Waterfall Model)\uFF1A\u9002\u7528\u4E8E\u9700\u6C42\u786E\u5B9A\uFF0C\u65E0\u5927\u7684\u9700\u6C42\u53D8\u66F4\uFF0C\u80FD\u91C7\u7528\u7EBF\u6027\u5DE5\u4F5C\u7684\u65B9\u5F0F\u5B8C\u6210</li><li>\u589E\u91CF\u6A21\u578B(Incremental Model)\uFF1A\u9002\u7528\u4E8E\u6838\u5FC3\u9700\u6C42\u975E\u5E38\u6E05\u695A\uFF0C\u4EBA\u5458\u4E0D\u8DB3\uFF0C\u9879\u76EE\u53EF\u5206\u5272\u6210\u4E0D\u540C\u9636\u6BB5\u5B8C\u6210</li><li>\u6F14\u5316\u6A21\u578B(Evolutionary Model) <ul><li>\u539F\u578B\u6A21\u578B(Prototype Model)\uFF1A\u9002\u7528\u4E8E\u9700\u6C42\u4E0D\u660E\u786E\u3001\u5E38\u53D8\u66F4\u7684\u60C5\u51B5\uFF0C\u9002\u5408\u89C4\u6A21\u4E0D\u662F\u5F88\u5927\u4E14\u4E0D\u590D\u6742\u7684\u7CFB\u7EDF</li><li>\u87BA\u65CB\u6A21\u578B(Spiral Model)\uFF1A\u5F3A\u8C03\u5206\u7EBF\u5206\u6790\uFF0C\u9002\u7528\u4E8E\u5E9E\u5927\u3001\u590D\u6742\u4E14\u5177\u6709\u9AD8\u98CE\u9669\u7684\u7CFB\u7EDF</li></ul></li><li>\u55B7\u6CC9\u6A21\u578B(Water Fountation Model)\uFF1A\u9002\u7528\u4E8E\u9762\u5411\u5BF9\u8C61\u7684\u5F00\u53D1\u8FC7\u7A0B\uFF0C\u65E0\u95F4\u9699</li><li>\u57FA\u4E8E\u6784\u4EF6\u7684\u5F00\u53D1\u6A21\u5F0F(Compenent-baseed Development Model)</li><li>\u5F62\u5F0F\u5316\u65B9\u6CD5\u6A21\u578B(Fromal Methods Model)</li><li>\u7EDF\u4E00\u8FC7\u7A0B\u6A21\u578B(UP) <ul><li>\u662F\u4E00\u79CD\u201C\u7528\u4F8B\u548C\u98CE\u9669\u9A71\u52A8\uFF0C\u4EE5\u67B6\u6784\u4E3A\u4E2D\u5FC3\uFF0C\u8FED\u4EE3\u5E76\u4E14\u589E\u91CF\u201D\u7684\u5F00\u53D1\u8FC7\u7A0B\uFF0C\u7531UML\u65B9\u6CD5\u548C\u5DE5\u5177\u652F\u6301\u3002</li><li>\u5B9A\u4E49\u4E864\u4E2A\u6280\u672F\u9636\u6BB5\u673A\u5668\u5236\u54C1\uFF1A <ol><li>\u8D77\u59CB\u9636\u6BB5\uFF08\u751F\u547D\u5468\u671F\u76EE\u6807\uFF09\u4E13\u6CE8\u4E8E\u9879\u76EE\u7684\u521D\u59CB\u6D3B\u52A8</li><li>\u7CBE\u5316\u9636\u6BB5\uFF08\u751F\u547D\u5468\u671F\u67B6\u6784\uFF09\u7406\u89E3\u4E86\u6700\u521D\u7684\u9886\u57DF\u8303\u56F4\u4E4B\u540E\uFF0C\u8FDB\u884C\u9700\u6C42\u5206\u6790\u548C\u67B6\u6784\u6F14\u8FDB</li><li>\u6784\u5EFA\u9636\u6BB5\uFF08\u521D\u8BD5\u8FD0\u4F5C\u529F\u80FD\uFF09\u5173\u6CE8\u7CFB\u7EDF\u7684\u6784\u5EFA\uFF0C\u4EA7\u751F\u5B9E\u73B0\u6A21\u578B</li><li>\u79FB\u4EA4\u9636\u6BB5\uFF08\u4EA7\u54C1\u53D1\u5E03\uFF09\u5173\u6CE8\u4E8E\u8F6F\u4EF6\u63D0\u4EA4\u65B9\u9762\u7684\u5DE5\u4F5C\uFF0C\u4EA7\u751F\u8F6F\u4EF6\u589E\u91CF</li><li>[\u751F\u4EA7\u9636\u6BB5 \u8FD0\u884C\u8F6F\u4EF6\u5E76\u76D1\u63A7\u8F6F\u4EF6\u7684\u6301\u7EED\u4F7F\u7528\uFF0C\u63D0\u4F9B\u8FD0\u884C\u73AF\u5883\u7684\u652F\u6301\uFF0C\u63D0\u4EA4\u8BC4\u4F30\u7F3A\u9677\u62A5\u544A\u548C\u53D8\u66F4\u8BF7\u6C42]</li></ol></li></ul></li><li>\u654F\u6377\u65B9\u6CD5(Agile Development) <ul><li>\u76EE\u6807\uFF1A\u901A\u8FC7\u201C\u5C3D\u53EF\u80FD\u7684\u65E9\u5730\u3001\u6301\u7EED\u5730\u5BF9\u6709\u4EF7\u503C\u7684\u8F6F\u4EF6\u7684\u4EA4\u4ED8\u201D\u662F\u5BA2\u6237\u6EE1\u610F</li></ul><ol><li>\u6781\u9650\u7F16\u7A0B(XP) <ul><li>4\u5927\u4EF7\u503C\u89C2\uFF1A\u6C9F\u901A\u3001\u7B80\u5355\u6027\u3001\u53CD\u9988\u548C\u52C7\u6C14</li><li>5\u4E2A\u539F\u5219\uFF1A\u5FEB\u901F\u53CD\u9988\u3001\u7B80\u5355\u6027\u5047\u8BBE\u3001\u9010\u6B65\u4FEE\u6539\u3001\u63D0\u5021\u66F4\u6539\u548C\u4F18\u8D28\u5DE5\u4F5C</li><li>12\u4E2A\u6700\u4F73\u5B9E\u8DF5\uFF1A\u8BA1\u5212\u6E38\u620F\u3001\u5C0F\u578B\u53D1\u5E03\u3001\u9690\u55BB\u3001\u7B80\u5355\u8BBE\u8BA1\u3001\u6D4B\u8BD5\u5148\u884C\u3001\u91CD\u6784\u3001\u7ED3\u5BF9\u7F16\u7A0B\u3001\u96C6\u4F53\u4EE3\u7801\u6240\u6709\u5236\u3001\u6301\u7EED\u96C6\u6210\u3001\u6BCF\u5468\u5DE5\u4F5C40\u4E2A\u5C0F\u65F6\u3001\u73B0\u573A\u5BA2\u6237\u548C\u7F16\u7801\u6807\u51C6</li></ul></li><li>\u6C34\u6676\u6CD5(Crystal)\uFF1A\u8BA4\u4E3A\u6BCF\u4E00\u4E2A\u4E0D\u540C\u7684\u9879\u76EE\u90FD\u9700\u8981\u4E00\u5957\u4E0D\u540C\u7684\u7B56\u7565</li><li>\u5E76\u5217\u4E89\u6C42\u6CD5(Scrum)\uFF1A\u4F7F\u7528\u8FED\u4EE3\u7684\u65B9\u6CD5 <ul><li>Product backlog\uFF0C\u4EA7\u54C1\u4EE3\u529E\u4E8B\u9879\u6E05\u5355</li><li>Sprint backlog\uFF0CSprint\u4EE3\u529E\u4E8B\u9879\u6E05\u5355</li><li>Sprint\uFF0C\u51B2\u523A\u8FED\u4EE3</li></ul></li><li>\u81EA\u9002\u5E94\u8F6F\u4EF6\u5F00\u53D1(ASD)</li><li>\u654F\u6377\u7EDF\u4E00\u8FC7\u7A0B(AUP)\uFF1A\u91C7\u7528\u201C\u5728\u5927\u578B\u4E0A\u8FDE\u7EED\u201D\u4EE5\u53CA\u201C\u5728\u5C0F\u578B\u4E0A\u8FED\u4EE3\u201D\u7684\u539F\u7406\u6765\u6784\u5EFA\u8F6F\u4EF6\u7CFB\u7EDF</li></ol></li></ul><hr><p>\u7EDF\u4E00\u8F6F\u4EF6\u5F00\u53D1\u8FC7\u7A0B\uFF08Rational Unified Process\uFF0CRUP\uFF09\u5E94\u7528\u4E864\u79CD\u91CD\u8981\u7684\u6A21\u578B\u5143\u7D20\uFF1A<code>\u89D2\u8272\uFF08\u8C01\u505A\uFF09</code>\u3001<code>\u6D3B\u52A8\uFF08\u600E\u4E48\u505A\uFF09</code>\u3001<code>\u5236\u54C1\uFF08\u505A\u4EC0\u4E48\uFF09</code>\u548C<code>\u5DE5\u4F5C\u6D41\uFF08\u4EC0\u4E48\u65F6\u5019\u505A\uFF09</code>\u3002</p><hr><ul><li><code>\u7518\u7279\u56FE(Gantt)</code>:\u8868\u793A\u4EFB\u52A1\u4F55\u65F6\u5F00\u59CB\uFF0C\u4F55\u65F6\u7ED3\u675F\uFF0C\u4EFB\u52A1\u7684\u5E76\u884C\u60C5\u51B5\uFF0C<code>\u4E0D\u80FD\u8868\u793A\u4F9D\u8D56\u5173\u7CFB</code></li><li><code>\u7F51\u7EDC\u56FE(PERT)</code>\uFF1A\u8868\u793A\u4EFB\u52A1\u4F55\u65F6\u5F00\u59CB\uFF0C\u4F55\u65F6\u7ED3\u675F\uFF0C\u4EFB\u52A1\u7684\u4F9D\u8D56\u5173\u7CFB\uFF0C<code>\u4E0D\u80FD\u8868\u793A\u5E76\u884C\u60C5\u51B5</code></li></ul><p>\u5173\u952E\u8DEF\u5F84\uFF1A\u9879\u76EE\u4E2D\u65F6\u95F4\u6700\u957F\u7684\u6D3B\u52A8\u987A\u5E8F</p><p><code>\u677E\u5F1B\u65F6\u95F4 = \u6700\u665A\u5F00\u59CB\u65F6\u95F4 - \u6700\u65E9\u5F00\u59CB\u65F6\u95F4</code></p><hr><p>\u5BF9\u8F6F\u4EF6\u5F00\u53D1\u8D44\u6E90\u8FDB\u884C\u89C4\u5212\u65F6\uFF0C\u4E3A\u4E86\u786E\u5B9A\u6784\u5EFA\u8F6F\u4EF6\u6240\u4EE5\u987B\u7684\u4EBA\u6570\uFF0C\u9700\u8981\u8003\u8651\u8F6F\u4EF6\u7CFB\u7EDF\u7684\u89C4\u6A21\u3001\u7CFB\u7EDF\u7684\u6280\u672F\u590D\u6742\u6027\u3001\u9879\u76EE\u8BA1\u5212\u548C\u5F00\u53D1\u4EBA\u5458\u7684\u6280\u672F\u80CC\u666F\u7B49\u65B9\u9762\uFF0C\u800C\u4E0E\u7CFB\u7EDF\u662F\u5426\u7531\u5E02\u573A\u524D\u666F\u65E0\u5173</p><hr><p>\u98CE\u9669\u662F\u4E00\u79CD\u5177\u6709\u8D1F\u9762\u540E\u679C\u3001\u4EBA\u4EEC\u4E0D\u5E0C\u671B\u53D1\u751F\u7684\u4E8B\u4EF6\u3002</p><p>\u901A\u5E38\u8BA4\u4E3A\u98CE\u9669\u5177\u6709\u4EE5\u4E0B\u7279\u70B9\uFF1A\u98CE\u9669\u662F\u53EF\u80FD\u53D1\u751F\u7684\u4E8B\u4EF6\uFF0C\u5176\u53D1\u751F\u7684\u53EF\u80FD\u6027\u7528\u98CE\u9669\u6982\u7387\u6765\u63CF\u8FF0\uFF1B\u98CE\u9669\u662F\u4F1A\u7ED9\u9879\u76EE\u7EC4\u5E26\u6765\u635F\u5931\u7684\u4E8B\u4EF6\uFF1B\u53EF\u80FD\u5BF9\u98CE\u9669\u8FDB\u884C\u5E72\u9884\uFF0C\u4EE5\u671F\u51CF\u5C11\u635F\u5931\u3002\u9488\u5BF9\u6BCF\u4E00\u79CD\u98CE\u9669\uFF0C\u5E94\u5F04\u6E05\u53EF\u80FD\u9020\u6210\u635F\u5931\u6216\u907F\u514D\u635F\u5931\u7684\u7A0B\u5EA6\u3002\u5BF9\u98CE\u9669\u52A0\u4EE5\u63A7\u5236\uFF0C\u91C7\u53D6\u4E00\u4E9B\u6709\u6548\u7684\u63AA\u65BD\u6765\u964D\u4F4E\u98CE\u9669\u6216\u662F\u6D88\u9664\u98CE\u9669\u3002</p><p>\u8F6F\u4EF6\u98CE\u9669\u4E00\u822C\u5305\u62EC<code>\u4E0D\u786E\u5B9A\u6027</code>\u548C<code>\u635F\u5931</code>\u4E24\u4E2A\u7279\u6027\uFF0C\u5176\u4E2D\u4E0D\u786E\u5B9A\u6027\u6307\u98CE\u9669\u53EF\u80FD\u53D1\u751F\uFF0C\u4E5F\u53EF\u80FD\u4E0D\u53D1\u751F\uFF1B\u635F\u5931\u662F\u5F53\u98CE\u9669\u786E\u5B9E\u53D1\u751F\u65F6\uFF0C\u4F1A\u5F15\u8D77\u7684\u4E0D\u5E0C\u671B\u7684\u540E\u679C\u548C\u635F\u5931\u3002</p><p>\u6551\u706B\u548C\u5371\u673A\u7BA1\u7406\u662F\u5BF9\u4E0D\u9002\u5408\u4F46\u7ECF\u5E38\u91C7\u7528\u7684\u8F6F\u4EF6\u98CE\u9669\u7BA1\u7406\u7B56\u7565\u3002</p><p><code>\u5DF2\u77E5\u98CE\u9669</code>\u548C<code>\u672A\u77E5\u98CE\u9669</code>\u662F\u5BF9\u8F6F\u4EF6\u98CE\u9669\u8FDB\u884C\u5206\u7C7B\u7684\u4E00\u79CD\u65B9\u5F0F\u3002</p><p>\u5458\u5DE5\u548C\u9884\u7B97\u662F\u5728\u8BC6\u522B\u9879\u76EE\u98CE\u9669\u65F6\u9700\u8981\u8BC6\u522B\u7684\u56E0\u7D20\u3002</p><p>\u98CE\u9669\u9884\u6D4B\u4ECE\u98CE\u9669\u53D1\u751F\u7684\u53EF\u80FD\u6027\u5927\u5C0F\u4EE5\u53CA\u98CE\u9669\u53D1\u751F\u65F6\u4EA7\u751F\u7684\u540E\u679C\u662F\u5426\u4E25\u91CD\u4E24\u65B9\u9762\u8BC4\u4F30\u98CE\u9669\u3002</p><ul><li>\u98CE\u9669\u5206\u6790\u5B9E\u9645\u4E0A\u662F4\u4E2A\u4E0D\u540C\u7684\u6D3B\u52A8\uFF1A <ul><li>\u98CE\u9669\u8BC6\u522B\uFF1A\u89C6\u56FE\u7CFB\u7EDF\u5316\u7684\u786E\u5B9A\u5BF9\u9879\u76EE\u8BA1\u5212\uFF08\u4F30\u7B97\u3001\u8FDB\u5EA6\u3001\u8D44\u6E90\u5206\u914D\uFF09\u7684\u5A01\u80C1</li><li>\u98CE\u9669\u9884\u6D4B\uFF1A\u53C8\u79F0\u98CE\u9669\u4F30\u7B97\uFF0C\u4ECE\u98CE\u9669\u53EF\u80FD\u53D1\u751F\u7684\u6982\u7387\u548C\u98CE\u9669\u53D1\u751F\u4EA7\u751F\u540E\u679C\u4E24\u65B9\u9762\u8BC4\u4F30</li><li>\u98CE\u9669\u8BC4\u4F30\uFF1A\u6839\u636E\u98CE\u9669\u53CA\u5176\u53D1\u751F\u7684\u6982\u7387\u548C\u4EA7\u751F\u7684\u5F71\u54CD\u9884\u6D4B\u662F\u5426\u5F71\u54CD\u53C2\u8003\u6C34\u5E73\u503C</li><li>\u98CE\u9669\u63A7\u5236\uFF1A\u8F85\u52A9\u9879\u76EE\u7EC4\u5EFA\u7ACB\u5904\u7406\u98CE\u9669\u7684\u7B56\u7565\uFF08\u98CE\u9669\u907F\u514D\u3001\u98CE\u9669\u76D1\u63A7\u3001\u98CE\u9669\u7BA1\u7406\u4EE5\u53CA\u610F\u5916\u4E8B\u4EF6\u8BA1\u5212\uFF09</li></ul></li></ul><p>\u98CE\u9669\u7BA1\u7406\u662F\u8F6F\u4EF6\u9879\u76EE\u7BA1\u7406\u7684\u4E00\u9879\u91CD\u8981\u4EFB\u52A1\u3002\u6839\u636E\u98CE\u9669\u7684\u4F18\u5148\u7EA7\u6765\u786E\u5B9A\u98CE\u9669\u63A7\u5236\u7B56\u7565\uFF0C\u800C\u4F18\u5148\u7EA7\u901A\u8FC7\u98CE\u9669\u66B4\u9732\u6765\u786E\u5B9A\u3002\u98CE\u9669\u66B4\u9732\u662F\u4E00\u79CD\u91CF\u5316\u98CE\u9669\u5F71\u54CD\u7684\u6307\u6807\u3002\u98CE\u9669\u63A7\u5236\u662F\u98CE\u9669\u7BA1\u7406\u7684\u4E00\u4E2A\u91CD\u8981\u6D3B\u52A8\u3002</p><hr><p>\u6210\u672C\u4F30\u7B97</p><ul><li><p>\u4E13\u5BB6\u4F30\u7B97\uFF1A\u4F9D\u8D56\u4E8E\u4E13\u5BB6\u7684\u80CC\u666F\u548C\u7ECF\u9A8C\uFF0C\u5177\u6709\u8F83\u5927\u7684\u4E3B\u89C2\u6027</p></li><li><p>Wolverton\u6A21\u578B\uFF1A\u57FA\u4E8E\u4E00\u4E2A\u6210\u672C\u4E3E\u8BC1\uFF0C\u5B9A\u4E49\u4E0D\u540C\u7684\u8F6F\u4EF6\u7C7B\u578B\uFF08\u63A7\u5236\u3001\u8F93\u5165/\u8F93\u51FA\u7B49\uFF09\u548C\u96BE\u6613\uFF08\u5BB9\u6613\u548C\u56F0\u96BE\uFF09\u7684\u6210\u672C\uFF0C\u57FA\u4E8E\u6B64\u6781\u7AEF\u8F6F\u4EF6\u5F00\u53D1\u7684\u6210\u672C</p></li><li><p>COCOMO\u6A21\u578B\uFF1A\u5C06\u89C4\u6A21\u89C6\u4E3A\u6210\u672C\u7684\u4E3B\u8981\u56E0\u7D20\uFF0C\u8003\u8651\u591A\u4E2A\u9A71\u52A8\u56E0\u5B50\u3002\u5728\u540E\u6765\u7684\u7248\u672CCOCOMO II \u4E2D\uFF0C\u8FD8\u8003\u8651\u4E86\u8F6F\u4EF6\u5F00\u53D1\u7684\u4E0D\u540C\u9636\u6BB5\uFF0C\u5305\u542B3\u4E2A\u9636\u6BB5\u6A21\u578B\uFF0C\u5373\u5E94\u7528\u7EC4\u88C5\u6A21\u578B\u3001\u65E9\u671F\u8BBE\u8BA1\u9636\u6BB5\u6A21\u578B\u548C\u4F53\u7CFB\u7ED3\u6784\u9636\u6BB5\u6A21\u578B</p><p>COCOMO\u75283\u4E2A\u4E0D\u540C\u5C42\u6B21\u7684\u6A21\u578B\u6765\u53CD\u6620\u4E0D\u540C\u7A0B\u5EA6\u7684\u590D\u6742\u6027\uFF0C\u5B83\u4EEC\u5206\u522B\u4E3A\uFF1A - \u57FA\u672C\u6A21\u578B\uFF08Basic Model\uFF09\uFF1A\u662F\u4E00\u4E2A\u9759\u6001\u5355\u53D8\u91CF\u6A21\u578B\uFF0C\u5B83\u7528\u4E00\u4E2A\u4EE5\u5DF2\u4F30\u7B97\u51FA\u6765\u7684\u6E90\u4EE3\u7801\u884C\u6570\uFF08LOC\uFF09\u4E3A\u81EA\u53D8\u91CF\u7684\u51FD\u6570\u6765\u8BA1\u7B97\u8F6F\u4EF6\u5F00\u53D1\u5DE5\u4F5C\u91CF\u3002 - \u4E2D\u7EA7\u6A21\u578B\uFF08Intermediate Model\uFF09\uFF1A\u5219\u5728\u7528LOC\u4E3A\u81EA\u53D8\u91CF\u7684\u51FD\u6570\u8BA1\u7B97\u8F6F\u4EF6\u5F00\u53D1\u5DE5\u4F5C\u91CF\u7684\u57FA\u7840\u4E0A\uFF0C\u518D\u7528\u6D89\u53CA\u4EA7\u54C1\u3001\u786C\u4EF6\u3001\u4EBA\u5458\u3001\u9879\u76EE\u7B49\u65B9\u9762\u5C5E\u6027\u7684\u5F71\u54CD\u56E0\u7D20\u6765\u8C03\u6574\u5DE5\u4F5C\u91CF\u7684\u4F30\u7B97\u3002 - \u8BE6\u7EC6\u6A21\u578B\uFF08Detailed Model\uFF09\uFF1A\u5305\u62EC\u4E2D\u7EA7COCOMO\u578B\u7684\u6240\u6709\u7279\u6027\uFF0C\u4F46\u7528\u4E0A\u8FF0\u5404\u79CD\u5F71\u54CD\u56E0\u7D20\u8C03\u6574\u5DE5\u4F5C\u91CF\u4F30\u7B97\u65F6\uFF0C\u8FD8\u8981\u8003\u8651\u5BF9\u8F6F\u4EF6\u5DE5\u7A0B\u8FC7\u7A0B\u4E2D\u5206\u6790\u3001\u8BBE\u8BA1\u7B49\u5404\u6B65\u9AA4\u7684\u5F71\u54CD\u3002</p><p>COCOMO II\u6A21\u578B\u4E5F\u9700\u8981\u4F7F\u7528\u89C4\u6A21\u4F30\u7B97\u4FE1\u606F\uFF0C\u5728\u6A21\u578B\u5C42\u6B21\u7ED3\u679C\u4E2D\u67093\u4E2D\u4E0D\u540C\u89C4\u6A21\u4F30\u7B97\u9009\u62E9\uFF1A\u5BF9\u8C61\u70B9\u3001\u529F\u80FD\u70B9\u3001\u4EE3\u7801\u884C</p></li></ul><hr><p>\u4EBA\u5458\u7BA1\u7406\u662F\u8F6F\u4EF6\u9879\u76EE\u7BA1\u7406\u7684\u4E00\u4E2A\u91CD\u8981\u90E8\u5206\uFF0C\u5728\u7EC4\u7EC7\u5F00\u53D1\u56E2\u961F\u65F6\uFF0C\u5E94\u8BE5\u8003\u8651\u5F00\u53D1\u4EBA\u5458\u7684\u5DE5\u4F5C\u80FD\u529B\u3001\u77E5\u8BC6\u80CC\u666F\u3001\u5DE5\u4F5C\u98CE\u683C\u3001\u5174\u8DA3\u7231\u597D\u7B49\u591A\u65B9\u9762\u7684\u56E0\u7D20\u3002\u6BCF\u4E2A\u6210\u5458\u7684\u5DE5\u4F5C\u4EFB\u52A1\u5E94\u8BE5\u5206\u914D\u6E05\u695A\uFF0C\u4E0D\u5E94\u8BE5\u53C2\u4E0E\u6240\u6709\u9636\u6BB5\u7684\u5DE5\u4F5C\u3002</p><hr><p>\u7ED3\u6784\u5316\u5206\u6790\u6A21\u578B\u5305\u62EC\u6570\u636E\u6D41\u56FE\u3001\u5B9E\u4F53\u8054\u7CFB\u56FE\u3001\u72B6\u6001\u8FC1\u79FB\u56FE\u548C\u6570\u636E\u5B57\u5178\u3002\u8FD9\u4E9B\u6A21\u578B\u662F\u9700\u6C42\u5206\u6790\u9636\u6BB5\u7684\u8F93\u51FA\u3002</p><p>\u786E\u5B9A\u8F6F\u4EF6\u4F53\u7CFB\u7ED3\u6784\u662F\u5728\u8F6F\u4EF6\u8BBE\u8BA1\u9636\u6BB5\u8FDB\u884C\u7684\u3002</p><p>\u7ED3\u6784\u5316\u5206\u6790\u7ED3\u679C\u7531\u4EE5\u4E0B\u51E0\u90E8\u5206\u7EC4\u6210\uFF1A\u4E00\u5957\u5206\u5C42\u7684\u6570\u636E\u6D41\u56FE\u3001\u4E00\u672C\u6570\u636E\u8BCD\u5178\u3001\u4E00\u7EC4\u5C0F\u8BF4\u660E\uFF08\u4E5F\u79F0\u52A0\u5DE5\u903B\u8F91\uFF09\u3001\u8865\u5145\u6750\u6599\u3002</p><hr><p>I/O\u8F6F\u4EF6\u9690\u85CF\u4E86I/O\u64CD\u4F5C\u5B9E\u73B0\u7684\u7EC6\u8282\u3002I/O\u8F6F\u4EF6\u5411\u7528\u6237\u63D0\u4F9B\u903B\u8F91\u63A5\u53E3\u3002I/O\u8F6F\u4EF6\u5C06\u786C\u4EF6\u4E0E\u8F83\u9AD8\u5C42\u6B21\u7684\u8F6F\u4EF6\u9694\u79BB\u5F00\u6765\uFF0C\u800C\u6700\u9AD8\u5C42\u8F6F\u4EF6\u5411\u5E94\u7528\u63D0\u4F9B\u4E00\u4E2A\u53CB\u597D\u7684\u3001\u6E05\u6670\u4E14\u7EDF\u4E00\u7684\u63A5\u53E3\uFF0C\u65B9\u4FBF\u7528\u6237\u4F7F\u7528\u3002</p><hr><p>\u6613\u7528\u6027\u7684\u5B50\u7279\u6027\u5305\u62EC\u6613\u7406\u89E3\u6027\u3001\u6613\u5B66\u6027\u3001\u6613\u64CD\u4F5C\u6027\uFF0C\u6613\u5206\u6790\u6027\u5C5E\u4E8E\u53EF\u7EF4\u62A4\u6027\u7684\u5B50\u7279\u6027\u3002</p><hr><p>\u8F6F\u4EF6\u53D8\u66F4\u63A7\u5236\u662F\u53D8\u66F4\u7BA1\u7406\u7684\u91CD\u8981\u5185\u5BB9\uFF0C\u8981\u6709\u6548\u8FDB\u884C\u53D8\u66F4\u63A7\u5236\uFF0C\u9700\u8981\u501F\u52A9\u914D\u7F6E\u6570\u636E\u5E93\u548C\u57FA\u7EBF\u7684\u6982\u5FF5\u3002<code>\u914D\u7F6E\u6570\u636E\u5E93\u4E00\u822C\u5305\u62EC\u5F00\u53D1\u5E93\u3001\u53D7\u63A7\u5E93\u548C\u4EA7\u54C1\u5E93</code>\u3002</p><hr><p>McCabe\u73AF\u8DEF\u590D\u6742\u5EA6\u8BA1\u7B97\uFF1A<code>G=m-n+2p</code>\uFF0C\u5176\u4E2D\u7ED3\u70B9\u6570n\uFF0C\u5F27\u6570m\uFF0Cp\u662F\u5F3A\u8FDE\u901A\u5206\u91CF\u4E2A\u6570</p><hr><p>\u8F6F\u4EF6\u590D\u6742\u6027\u5EA6\u91CF\u662F\u8F6F\u4EF6\u5EA6\u91CF\u7684\u4E00\u4E2A\u91CD\u8981\u5206\u652F\uFF0C\u5176\u4E3B\u8981\u53C2\u6570\u6709\uFF1A</p><ul><li>\u89C4\u6A21\uFF1A\u603B\u5171\u7684\u6307\u4EE4\u6570\u6216\u6E90\u4EE3\u7801\u884C\u6570</li><li>\u96BE\u5EA6\uFF1A\u901A\u5E38\u7531\u64CD\u4F5C\u6570\u7684\u6570\u76EE\u6240\u51B3\u5B9A</li><li>\u7ED3\u6784\uFF1A\u901A\u5E38\u4E0E\u7A0B\u5E8F\u7ED3\u6784\u6709\u5173\u7684\u5EA6\u91CF\u6765\u8868\u793A</li><li>\u667A\u80FD\u5EA6\uFF1A\u5373\u7B97\u6CD5\u7684\u96BE\u6613\u7A0B\u5EA6</li></ul><hr><p>\u5197\u4F59\u6280\u672F\u5206\u4E3A\u56DB\u7C7B\uFF1A</p><ul><li>\u7ED3\u6784\u5197\u4F59</li><li>\u4FE1\u606F\u5197\u4F59</li><li>\u65F6\u95F4\u5197\u4F59</li><li>\u5197\u4F59\u9644\u52A0\u6280\u672F</li></ul><hr><table><thead><tr><th>\u8D28\u91CF\u7279\u6027</th><th>\u8D28\u91CF\u5B50\u7279\u6027</th></tr></thead><tbody><tr><td>\u529F\u80FD\u6027</td><td>\u9002\u5408\u6027\uFF0C\u51C6\u786E\u6027\uFF0C\u4E92\u7528\u6027\uFF0C\u4F9D\u4ECE\u6027\uFF0C\u5B89\u5168\u6027</td></tr><tr><td>\u53EF\u9760\u6027</td><td>\u6210\u719F\u6027\uFF0C\u5BB9\u9519\u6027\uFF0C\u6613\u6062\u590D\u6027</td></tr><tr><td>\u6613\u7528\u6027</td><td>\u6613\u7406\u89E3\u6027\uFF0C\u6613\u5B66\u6027\uFF0C\u6613\u64CD\u4F5C\u6027</td></tr><tr><td>\u6548\u7387</td><td>\u65F6\u95F4\u7279\u6027\uFF0C\u8D44\u6E90\u7279\u6027</td></tr><tr><td>\u53EF\u7EF4\u62A4\u6027</td><td>\u6613\u5206\u6790\u6027\uFF0C\u6613\u6539\u53D8\u6027\uFF0C\u7A33\u5B9A\u6027\uFF0C\u6613\u6D4B\u8BD5\u6027</td></tr><tr><td>\u53EF\u79FB\u690D\u6027</td><td>\u9002\u5E94\u6027\uFF0C\u6613\u5B89\u88C5\u6027\uFF0C\u4E00\u81F4\u6027\uFF0C\u6613\u66FF\u6362\u6027</td></tr></tbody></table><p>\u8F6F\u4EF6\u7EF4\u62A4\u7684\u5DE5\u4F5C\u91CF\u6BD4\u5F00\u53D1\u9636\u6BB5\u7684\u5DE5\u4F5C\u91CF\u5927\u3002\u8F6F\u4EF6\u7684\u6B63\u786E\u6027\u662F\u6307\u8F6F\u4EF6\u5B8C\u6210\u6240\u9700\u529F\u80FD\u7684\u7A0B\u5EA6\uFF0C\u5C3D\u7BA1\u8FD9\u79CD\u7A0B\u5EA6\u4E0E\u6BCF\u5343\u884C\u4EE3\u7801\u7684\u6545\u969C\u6570\u6709\u5173\uFF0C\u4F46\u4E0D\u5B8C\u5168\u7B49\u540C\u3002\u8F6F\u4EF6\u5B8C\u6574\u6027\u662F\u6307\u8F6F\u4EF6\u5728\u5B89\u5168\u65B9\u9762\u6297\u653B\u51FB\u7684\u80FD\u529B\u3002\u8F6F\u4EF6\u53EF\u7528\u6027\u662F\u5EA6\u91CF\u8F6F\u4EF6\u7684&quot;\u7528\u6237\u53CB\u597D\u6027&quot;\uFF1A\u5B66\u4F1A\u64CD\u4F5C\u8F6F\u4EF6\u6240\u9700\u4F53\u529B/\u667A\u529B\uFF1B\u5BF9\u8F6F\u4EF6\u7684\u4F7F\u7528\u8FBE\u5230\u4E2D\u7B49\u6548\u7387\u6240\u9700\u7684\u65F6\u95F4\uFF1B\u4F46\u7CFB\u7EDF\u4E2D\u7531\u4E00\u4E2A\u4E2D\u7B49\u6548\u7387\u7684\u4EBA\u4F7F\u7528\u65F6\u6D4B\u91CF\u5230\u7684\u751F\u4EA7\u7387\u589E\u957F\u503C\uFF1B\u7528\u6237\u5BF9\u7CFB\u7EDF\u7684\u4E3B\u89C2\u8BC4\u4EF7\u3002</p><hr><p>\u6A21\u5757\u7ED3\u6784\u8BC4\u5BA1\uFF0C\u4E3B\u8981\u5305\u62EC\uFF1A1.\u63A7\u5236\u6D41\u7ED3\u6784\uFF1B2.\u6570\u636E\u6D41\u7ED3\u6784\uFF1B3.\u6A21\u5757\u7ED3\u6784\u4E0E\u6A21\u5757\u7ED3\u6784\u4E4B\u95F4\u7684\u5BF9\u5E94\u5173\u7CFB\u3002</p><hr><p>\u8F6F\u4EF6\u6D4B\u8BD5\u7684\u8C03\u8BD5\u65B9\u6CD5\uFF1A</p><ul><li>\u8BD5\u63A2\u6CD5\uFF1A\u5206\u6790\u9519\u8BEF\u75C7\u72B6\uFF0C\u731C\u6D4B\u95EE\u9898\u6240\u5728\u4F4D\u7F6E\uFF0C\u4E00\u6B65\u4E00\u6B65\u8BD5\u63A2\u548C\u5206\u6790\u9519\u8BEF\u6240\u5728\u3002</li><li>\u56DE\u6EAF\u6CD5\uFF1A\u4ECE\u53D1\u73B0\u95EE\u9898\u7684\u5730\u65B9\u5F00\u59CB\uFF0C\u6CBF\u7740\u7A0B\u5E8F\u63A7\u5236\u7CFB\u7EDF\u8FFD\u8E2A\u4EE3\u7801\uFF0C\u76F4\u5230\u627E\u5230\u9519\u8BEF\u3002</li><li>\u5BF9\u5206\u67E5\u627E\u6CD5\uFF1A\u5DF2\u77E5\u7A0B\u5E8F\u4E2D\u82E5\u5E72\u4F4D\u7F6E\u7684\u6B63\u786E\u53D6\u503C\uFF0C\u4ECE\u8FD9\u4E9B\u4F4D\u7F6E\u7ED9\u53D8\u91CF\u4EE5\u6B63\u786E\u7684\u503C\uFF0C\u89C2\u5BDF\u7A0B\u5E8F\u8FD0\u884C\u7684\u8F93\u51FA\u7ED3\u679C\uFF0C\u5982\u679C\u6CA1\u6709\u95EE\u9898\uFF0C\u8BF4\u660E\u4ECE\u8D4B\u4E88\u53D8\u91CF\u4E00\u4E2A\u503C\u5F00\u59CB\u5230\u7ED3\u679C\u8F93\u51FA\u4E4B\u95F4\u7684\u7A0B\u5E8F\u6CA1\u6709\u95EE\u9898\uFF0C\u95EE\u9898\u53EF\u80FD\u5728\u9664\u6B64\u4EE5\u5916\u7684\u7A0B\u5E8F\u4E2D\uFF0C\u968F\u6C57\u6709\u9519\u8BEF\u7684\u7A0B\u5E8F\u6BB5\u518D\u4F7F\u7528\u8BE5\u65B9\u6CD5\uFF0C\u76F4\u5230\u628A\u8303\u56F4\u7F29\u5C0F\u5230\u6BD4\u8F83\u5BB9\u6613\u8BCA\u65AD\u4E3A\u6B62\u3002</li><li>\u5F52\u7EB3\u6CD5\uFF1A\u4ECE\u6D4B\u8BD5\u6240\u66B4\u9732\u7684\u95EE\u9898\u51FA\u53D1\uFF0C\u6536\u96C6\u6240\u6709\u6B63\u786E\u6216\u4E0D\u6B63\u786E\u7684\u6570\u636E\uFF0C\u5206\u6790\u5B83\u4EEC\u4E4B\u95F4\u7684\u5173\u7CFB\uFF0C\u63D0\u51FA\u5047\u60F3\uFF0C\u7528\u8FD9\u4E9B\u6570\u636E\u6765\u8BC1\u660E\u6216\u53CD\u9A73\uFF0C\u4ECE\u800C\u67E5\u51FA\u9519\u8BEF\u6240\u5728\u3002</li><li>\u6F14\u7ECE\u6CD5\uFF1A\u6839\u636E\u6D4B\u8BD5\u7ED3\u679C\uFF0C\u5217\u51FA\u6240\u6709\u53EF\u80FD\u7684\u9519\u8BEF\u539F\u56E0\uFF1B\u5206\u6790\u5DF2\u6709\u6570\u636E\uFF0C\u6392\u9664\u4E0D\u53EF\u80FD\u548C\u5F7C\u6B64\u77DB\u76FE\u7684\u539F\u56E0\uFF1B\u5BF9\u4E8E\u5176\u4ED6\u539F\u56E0\uFF0C\u9009\u62E9\u53EF\u80FD\u6027\u6700\u5927\u7684\uFF0C\u5229\u7528\u5DF2\u6709\u7684\u6570\u636E\u5B8C\u5584\u8BE5\u5047\u8BBE\uFF1B\u7528\u5047\u8BBE\u6765\u89E3\u91CA\u6240\u6709\u539F\u59CB\u6D4B\u8BD5\u7ED3\u679C\uFF0C\u5982\u679C\u80FD\u89E3\u91CA\u8FD9\u4E00\u5207\uFF0C\u4E5F\u5C31\u627E\u51FA\u4E86\u9519\u8BEF\uFF0C\u5426\u5219\uFF0C\u8981\u4E48\u5F0F\u5047\u8BBE\u4E0D\u5B8C\u5907\u6216\u4E0D\u6210\u7ACB\uFF0C\u8981\u4E48\u6709\u591A\u4E2A\u9519\u8BEF\u540C\u65F6\u5B58\u5728\uFF0C\u9700\u8981\u91CD\u65B0\u5206\u6790\u63D0\u51FA\u65B0\u7684\u7ED3\u793E\uFF0C\u76F4\u5230\u53D1\u73B0\u9519\u8BEF\u4E3A\u6B62\u3002</li></ul>",64),p=[o];function r(c,n){return i(),t("div",null,p)}const h=l(e,[["render",r],["__file","fundamentals-of-software-engineering.html.vue"]]);export{h as default};
